import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open the mobile menu
    await page.click('.nav-menu'); // Click on the mobile menu button
    await page.waitForSelector('.mobile-menu', { timeout: 5000 }); // Wait for the mobile menu to appear
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_mobile_menu_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_mobile_menu_opened.png'));

    // Interact with menu items
    await page.click('text=Your Profile'); // Click on 'Your Profile' link
    await page.waitForSelector('.profile-page', { timeout: 5000 }); // Wait for profile page to load
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_profile_page.png'));

    // Close the mobile menu
    await page.click('.close-mobile-menu'); // Click on the close button
    await page.waitForSelector('.mobile-menu', { state: 'hidden', timeout: 5000 }); // Wait for the mobile menu to close
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_mobile_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_mobile_menu_closed.png'));

    return {
      success: true,
      action: "Tested mobile menu navigation and interacted with profile link",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
